const WalletNotConnected = () => {
  const TranslateString = useI18n()

  return (
    <div>
      <Heading size="xl" mb="8px">
        {TranslateString(852, 'Oops!')}
      </Heading>
      <Text as="p" mb="16px">
        {TranslateString(999, 'Please connect your wallet to continue')}
      </Text>
      <UnlockButton />
    </div>
  )
}

export default WalletNotConnected
